description:
Following the release of the manga, an anime TV series produced by Gonzo, based on the manga of the same name by Kouta Hirano. The 13-episode TV series was produced by Gonzo in 2001, with the story and characters quite different from the original manga. The TV series was broadcast on Fuji Television in Japan from October 10, 2001 to January 16, 2002 and in the US on Starz!&amp;#039;s Encore Action channel from October 4, 2003 to December 27, 2003.


